import React from 'react'; 
import { Box } from 'reactjs-admin-lte';
function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Box>
  <Box.Header>
    <Box.Title>Hello, world!</Box.Title>
  </Box.Header>
  <Box.Body>
    Thanks for choosing reactjs-admin-lte.
  </Box.Body>
</Box>
      </header>
    </div>
  );
}

export default App;
